import React,{Component} from 'react';
import Persons from './persons'

function NameList(){
	const persons = {
		name:'bob',
		id:'2'}
        const personsList = persons.map((person) =>  <h1>{person.name}</h1>)
	
    return (<div>{personsList}</div>)
}	
export default NameList
